const React = require('react');
const Layout = require('./Layout');

module.exports = function ReportWMY({newUser}){
    return(
        <Layout newUser={newUser}>
   <ul className='hr'>
    <li><button id='day' type="submit" className="btn btn-primary">За день</button></li>
    <li><button id='week' type="submit" className="btn btn-primary">За неделю</button></li>
    <li><button id='month' type="submit" className="btn btn-primary">За месяц</button></li>
   </ul>
        </Layout>
    )
}

